package com.mycompany.veterinaria.model;import com.fasterxml.jackson.annotation.JsonManagedReference;import jakarta.persistence.*;import lombok.Getter;import lombok.Setter;import java.util.List;@Getter @Setter@Entitypublic class Duenho {    @Id    @GeneratedValue(strategy = GenerationType.SEQUENCE)    @Column(name = "id_duenho")    private  Long idDuenho;    private String dni ;    private String nombreDuenho ;    private String apellidoDuenho;    private String celularDuenho;    @OneToMany(mappedBy = "duenho", cascade = CascadeType.ALL, orphanRemoval = true)    @JsonManagedReference    private List<Mascota> mascotas;    public Duenho() {    }    public Duenho(Long idDuenho, String dni, String nombreDuenho, String apellidoDuenho, String celularDuenho, List<Mascota> mascotas) {        this.idDuenho = idDuenho;        this.dni = dni;        this.nombreDuenho = nombreDuenho;        this.apellidoDuenho = apellidoDuenho;        this.celularDuenho = celularDuenho;        this.mascotas = mascotas;    }}